    {
      int numberOfSpectra = Octane_Spectra.Length;
      int numberOfSpectralPoints = Octane_Spectra[0].Length;
      int numberOfTargetVariables = 1;
      var sx = Enumerable.Range(0, numberOfSpectralPoints).Select(x => 900.0 + 2 * x).ToArray(); // spectral x values
